import bisect


def dist(x1, y1, x2, y2):
    return math.sqrt((x1 - x2) ** 2 + (y1 - y2) ** 2)


def solve():
    n = int(input())
    droplets = []
    for i in range(n):
        x, y, vx, vy, r = list(map(int, input().split()))
        droplets.append((x, y, vx, vy, r, i))
    droplets.sort(key=lambda x: x[0])
    n = len(droplets)
    if n == 1:
        return 1, 0
    if n == 2:
        x1, y1, vx1, vy1, r1, i1 = droplets[0]
        x2, y2, vx2, vy2, r2, i2 = droplets[1]
        if dist(x1, y1, x2, y2) < r1 + r2:
            return 1, dist(x1, y1, x2, y2) / (r1 + r2)
        else:
            return 2, 0
    ans = 2
    t = 0
    while True:
        t += 1
        if t > 10 ** 9:
            return ans, t
        new_droplets = []
        for i in range(n):
            x1, y1, vx1, vy1, r1, i1 = droplets[i]
            x1 += vx1
            y1 += vy1
            new_droplets.append((x1, y1, vx1, vy1, r1, i1))
        new_droplets.sort(key=lambda x: x[0])
        n = len(new_droplets)
        if n == 1:
            return 1, t
        if n == 2:
            x1, y1, vx1, vy1, r1, i1 = new_droplets[0]
            x2, y2, vx2, vy2, r2, i2 = new_droplets[1]
            if dist(x1, y1, x2, y2) < r1 + r2:
                return 1, t
            else:
                return 2, t
        for i in range(n):
            x1, y1, vx1, vy1, r1, i1 = new_droplets[i]
            for j in range(i + 1, n):
                x2, y2, vx2, vy2, r2, i2 = new_droplets[j]
                if dist(x1, y1, x2, y2) < r1 + r2:
                    new_droplets.append(
                        (x1 * r1 + x2 * r2) / (r1 + r2),
                        y1 * r1 + y2 * r2) / (r1 + r2),
                        (vx1 * r1 + vx2 * r2) / (r1 + r2),
                        (vy1 * r1 + vy2 * r2) / (r1 + r2),
                        r1 + r2,
                        -1)
                    ans -= 1
                    n += 1
                    new_droplets.sort(key=lambda x: x[0])
                    break
        if ans == 1:
            return 1, t
        if ans == 2:
            return 2, t


def __starting_point():
    sys.setrecursionlimit(1000000)
    print(' '.join(map(str, solve())))


