def is_palindrome(n, base):
    s = ''
    while n > 0:
        s += str(n % base)
        n //= base
    return s == s[::-1]


def main():
    a, b, k = list(map(int, input().split()))
    ans = 0
    for i in range(a, b+1):
        if all(is_palindrome(i, j) for j in range(2, k+1)):
            ans += 1
    print(ans)


