def cost(s, x, y):
    n = len(s)
    dp = [[0 for i in range(n+1)] for j in range(2)]
    for i in range(1, n+1):
        for j in range(2):
            if s[i-1] == '?':
                dp[j][i] = min(dp[1-j][i-1]+x, dp[1-j][i-1]+y)
            elif s[i-1] == '0':
                dp[0][i] = dp[0][i-1]+x
                dp[1][i] = dp[1][i-1]+y
            else:
                dp[0][i] = dp[0][i-1]+y
                dp[1][i] = dp[1][i-1]+x
    return min(dp[0][n], dp[1][n])


