    dist = {start: 0}
    q = [(0, start)]
    while q:
        d, v = min(q)
        if v == goal:
            return d
        q.remove((d, v))
        for u, w in graph[v]:
            if u in dist:
                if dist[u] > d + w:
                    dist[u] = d + w
                    q.append((dist[u], u))
            else:
                dist[u] = d + w
                q.append((dist[u], u))


