words = [input().rstrip() for _ in range(n)]
start, end = words[0], words[1]
words = set(words[2:])


def bfs():
    q = deque([(start, 0)])
    visited = set([start])
    while q:
        word, step = q.popleft()
        for i in range(len(word)):
            for c in 'abcdefghijklmnopqrstuvwxyz':
                next_word = word[:i] + c + word[i+1:]
                if next_word == end:
                    return step+1
                if next_word in words and next_word not in visited:
                    visited.add(next_word)
                    q.append((next_word, step+1))
    return -1


def check(word):
    for i in range(len(word)):
        for c in 'abcdefghijklmnopqrstuvwxyz':
            next_word = word[:i] + c + word[i+1:]
            if next_word in words:
                return True
    return False


ans = 0
for word in words:
    if check(word):
        continue
    words.add(word)
    step = bfs()
    if step != -1:
        ans = word
        break
    words.remove(word)
print(ans if ans else 0)
