def gcd(a, b):
    if a < b:
        a, b = b, a
    while b:
        a, b = b, a % b
    return a


def lcm(a, b):
    return a * b // gcd(a, b)


def solve():
    n, k = list(map(int, input().split()))
    cards = []
    for i in range(n):
        w, h, q = list(map(int, input().split()))
        cards.append((w, h, q))
    cards.sort(key=lambda x: x[0] * x[1])
    cards.reverse()
    ans = 10**18
    for i in range(1 << n):
        if bin(i).count('1') > k:
            continue
        w = 1
        h = 1
        for j in range(n):
            if i >> j & 1:
                w = max(w, cards[j][0])
                h = max(h, cards[j][1])
        w *= 2
        h *= 2
        area = w * h
        waste = 0
        for j in range(n):
            if i >> j & 1:
                waste += cards[j][2] * (area - cards[j][0] * cards[j][1])
        ans = min(ans, waste)
    print(ans)


